package com.flash.blogbackup.model;/** * @author cairne huangyihua@diandian.com * @date Sep 27, 2011 */public class ImageItem {    private String rawUrl;    private String desUrl;    public static volatile int sn = 0;    public ImageItem(String rawUrl, String desUrl) {        this.rawUrl = rawUrl;        this.desUrl = desUrl;    }    public static synchronized void incSn() {        sn++;    }    public String getRawUrl() {        return rawUrl;    }    public String getDesUrl() {        return desUrl;    }}